    //将字符串解析为对象
    function parseStrObjByRegExpKV(strDes) {//字符串转化为对象（正则表达式方式）parseStrObjByRegExpKV("name=jack&age=20&love=lily");
        var obj = {};
        strDes.replace(/(\w+)(?:=([^&]*))?/g, function (str, key, value) {
            obj[key] = value;
        });
        return obj;
    }

