     function uniqueArr(arr){
        let result = {};
        let finalResult=[];
        for(let i=0;i<arr.length;i++){
            result[arr[i]["ID"]]=arr[i];//这里必须知晓"ID"为主键
        }
        
        for(item in result){
            finalResult.push(result[item]);
        }
        return finalResult;
    }


